BEGIN TRANSACTION;

-- Новая таблица schedule с колонкой week_of_cycle
DROP TABLE IF EXISTS schedule;

CREATE TABLE schedule (
  id INTEGER PRIMARY KEY AUTOINCREMENT,
  group_id INTEGER NOT NULL,
  subgroup INTEGER NOT NULL,
  weekday INTEGER NOT NULL,
  lesson_number INTEGER NOT NULL,
  week_of_cycle INTEGER NOT NULL CHECK(week_of_cycle BETWEEN 1 AND 4),
  subject_id INTEGER NOT NULL,
  teacher_id INTEGER NOT NULL,
  room TEXT,
  FOREIGN KEY (group_id) REFERENCES groups(id),
  FOREIGN KEY (subject_id) REFERENCES subjects(id),
  FOREIGN KEY (teacher_id) REFERENCES users(id)
);

-- Индексы для быстрого поиска
CREATE INDEX idx_schedule_group_week ON schedule(group_id, weekday, week_of_cycle);
CREATE INDEX idx_schedule_teacher ON schedule(teacher_id);
CREATE INDEX idx_schedule_room ON schedule(room);


COMMIT;

